import React from 'react';
import './App.scss';

import { Header } from './components/Header';
import { ProductDetails } from './components/ProductDetails';
import { ImageBanner } from './components/ImageBanner';

function App() {
  return (
    <>
      <Header/>
      <ProductDetails/>
      <ImageBanner/>
    </>
  );
}

export default App;
